import WaitingOfSigning from '../aggregatedStates/WaitingOfSigning';
const WaitingForBuyer = {
    name: 'waiting_for_buyer',
    label: 'Ожидание подписания покупателем',
    type: 'OUT',
    aggregatedState: WaitingOfSigning
};
